class Main3 extends Component{
	render() {
		return (
			<div>
				<img className="background_image_card" src={main_img_3} />
				<h3 className="background_image_font">

					<p>Wedding</p>
					<p>at</p>
					<p>Palace</p>
					<p>Baraat at 11 am</p>
					<p></p>
				</h3>

			</div>
		)
	}
}

export default Main3
